import {Route, BrowserRouter, Routes} from 'react-router-dom'
import Home from './Home';
import MainInfo from './MainInfo';

function App() {

  return (
    <div className="App">
      <div className='shadow'></div>
    <BrowserRouter>
      <Routes>
        <Route path='/' element={<Home/>}/>
        <Route path='/info/:name' element={<MainInfo/>}/>
      </Routes>
    </BrowserRouter>
    </div>
  );
}

export default App;
